  true,\n\t\"url\": null,\n\t\"notes\": \"The dataset includes scanned-from-paper
  images of technical publications.  It does not include ground-truth text labels.
  \ To satisfy resource constraints of the early 1990s, these images are encoded in
  CCITT Group 4 fax binary compressed format with a non-standard header.  They can
  only be accessed using tools that must be compiled.  That software is written in
  standard K&R C.  There are no pre-compiled binaries. Significant software engineering
  resources will need to be dedicated to this.\",\n\t\"license_title\": \"Other License
